SET NAMES 'UTF8';
SET FOREIGN_KEY_CHECKS = 0;

DROP TABLE IF EXISTS `CAR_CLASSES` CASCADE;
CREATE TABLE `CAR_CLASSES` (
	`CarClass` varchar(50) NOT NULL,
	`Seats` int,
	`Standees` int,
	PRIMARY KEY (`CarClass`)
);


DROP TABLE IF EXISTS `DIR_LOOKUP` CASCADE;
CREATE TABLE `DIR_LOOKUP` (
	`CAR_CLASS` varchar(50) COMMENT 'This only applies to R68 (and R46 although we haven\'t used them).',
	`FORM_DIR` varchar(50) NOT NULL,
	`SPACE` varchar(50) NOT NULL,
	`SEAT_DIR` varchar(1) COMMENT '(F)orward vs (B)ackward',
	PRIMARY KEY (`FORM_DIR`, `SPACE`),
	INDEX `FORM_ID` (`FORM_DIR` ASC)
);


DROP TABLE IF EXISTS `FORM_TBL` CASCADE;
CREATE TABLE `FORM_TBL` (
	`FORM_ID` int NOT NULL,
	`DATE` datetime,
	`FROM` varchar(50),
	`TO` varchar(50),
	`LV_TIME` datetime,
	`ARR_TIME` datetime,
	`CAR_CLASS` varchar(50),
	`LINE` varchar(50),
	`FORM_DIR` varchar(1),
	`OCCUPANCY` float,
	PRIMARY KEY (`FORM_ID`),
	INDEX `FORM_ID` (`FORM_ID` ASC),
	INDEX `FORM_TBLCar_Class` (`CAR_CLASS` ASC),
	INDEX `FORM_TBLFORM_DIR` (`FORM_DIR` ASC)
);


DROP TABLE IF EXISTS `LOOKUP_TBL` CASCADE;
CREATE TABLE `LOOKUP_TBL` (
	`Car_Class` varchar(50) NOT NULL,
	`Space` varchar(50) NOT NULL,
	`Position` int COMMENT '0=stand; 1=seat; 2=flipping seat',
	`Pole` char,
	`Wall` int COMMENT '0=no wall nearby; 1=wall on the left; 2=wall on the right; 3=wall on the back (e.g. end seats on R68); 4=standing room at the end of car',
	`Door` int COMMENT '0=no door nearby; 1=door on left of the seat; 2=door on right of the seat; 3=standing room by door, doors face each other on both sides; 4=standing room by door, doors don\'t face each other; 5=door on left of flip seat; 6=door on right of flip seat.',
	`Map` int COMMENT '0=no map nearby; 1=seat near map; 2=seat facing map; 3=standing room near map',
	`Legroom` int COMMENT '0=no legroom nearby; 1=legroom on the left; 2=legroom on the right',
	`Perpendicular` int COMMENT '0=longtidudal seat; 1=window on the left; 2=aisle on the right; 3=aisle on the left; 4=window on the right.',
	`SeatPole` int COMMENT '0=no poll; 1=poll on the left; 2=poll on the right',
	`Vestibule` char,
	PRIMARY KEY (`Car_Class`, `Space`),
	INDEX `LOOKUP_TBLCAR_CLASS` (`Car_Class` ASC),
	INDEX `LOOKUP_TBLSpace` (`Space` ASC)
);


DROP TABLE IF EXISTS `RECORDS` CASCADE;
CREATE TABLE `RECORDS` (
	`Record_ID` int,
	`Form_ID` int NOT NULL,
	`Gender` varchar(1) COMMENT '(M)ale vs (F)emale vs (B)oy vs (G)irl vs (1) large person from a neighborin seat vs (2)wheelchair vs (3)baby stroller vs (4)luggage vs (5) legs on a seat or arm extended to faraway pole',
	`Space` varchar(3) NOT NULL,
	`Large_Psgr` char,
	`Legs_on_Seat` char COMMENT '(or arms on faraway pole)',
	`Bag` char,
	PRIMARY KEY (`Form_ID`, `Space`),
	INDEX `Form_ID` (`Form_ID` ASC),
	INDEX `Record_ID` (`Record_ID` ASC),
	INDEX `RECORDSSpace` (`Space` ASC)
);


ALTER TABLE `FORM_TBL` ADD CONSTRAINT `CAR_CLASSESFORM_TBL` FOREIGN KEY (`CAR_CLASS`) REFERENCES `CAR_CLASSES` (`CarClass`) ON UPDATE SET NULL ON DELETE SET NULL;
ALTER TABLE `DIR_LOOKUP` ADD CONSTRAINT `FORM_TBLDIR_LOOKUP` FOREIGN KEY (`FORM_DIR`) REFERENCES `FORM_TBL` (`FORM_DIR`) ON UPDATE SET NULL ON DELETE SET NULL;
ALTER TABLE `RECORDS` ADD CONSTRAINT `FORM_TBLRECORDS` FOREIGN KEY (`Form_ID`) REFERENCES `FORM_TBL` (`FORM_ID`) ON UPDATE SET NULL ON DELETE SET NULL;
ALTER TABLE `FORM_TBL` ADD CONSTRAINT `LOOKUP_TBLFORM_TBL` FOREIGN KEY (`CAR_CLASS`) REFERENCES `LOOKUP_TBL` (`Car_Class`) ON UPDATE SET NULL ON DELETE SET NULL;
ALTER TABLE `RECORDS` ADD CONSTRAINT `LOOKUP_TBLRECORDS` FOREIGN KEY (`Space`) REFERENCES `LOOKUP_TBL` (`Space`) ON UPDATE SET NULL ON DELETE SET NULL;


SET FOREIGN_KEY_CHECKS = 1;
